import React, {useState} from 'react';
import axios from 'axios';
import { BrowserRouter as Router,Switch,Route,useParams,withRouter } from "react-router-dom";
import { API_BASE_URL,ACCESS_TOKEN_NAME } from '../../constants/apiConstants';
import { Navbar,Nav,NavDropdown,Form,FormControl,Button } from 'react-bootstrap'
import LoginForm from './components/LoginForm/LoginForm';
import RegistrationForm from './components/RegistrationForm/RegistrationForm';
import Home from './components/Home/Home';
import AboutUs from './components/HookState/HookState';
import ContactUs from './components/CounterExample/CounterExample';
import CustomCounter from './components/CustomCounter/CustomCounter';
import Parent from './components/ParenttoChild/Parent';
import Child from './components/ChildtoParent/Child';
import Employee from './components/Employee/Employee';
import AddEmployee from './AddEmployee/AddEmployee';
function Header(props) {
    const [state , setState] = useState({
        successMessage: null
    })
    const capitalize = (s) => {
        if (typeof s !== 'string') return ''
        return s.charAt(0).toUpperCase() + s.slice(1)
    }
    let title = capitalize(props.location.pathname.substring(1,props.location.pathname.length))
    if(props.location.pathname === '/') {
        title = 'Welcome'
    }
    function renderLogout() {
        if(props.location.pathname === '/home'){
            return(
                <div className="ml-auto">
                    <button className="btn btn-danger" onClick={() => handleLogout()}>Logout</button>
                </div>
            )
        }
    }
    function handleLogout() {
        var token_base64= localStorage.getItem(ACCESS_TOKEN_NAME);
        var token = atob(token_base64);
        let header = {
            'Authorization': `Bearer ${token}`,
          };
            axios.post(API_BASE_URL+'api/auth/logout',{}, { headers: header})
            .then(function (response) {
                if(response.status==200){
                    setState(prevState => ({
                        ...prevState,
                        'successMessage' : response.data.message
                    }))
                    localStorage.removeItem(ACCESS_TOKEN_NAME)
                    props.history.push('/login')
                }
                if(response.status !== 200){
                    props.history.push('/home')
                }
            })
            .catch(function (error) {
                props.history.push('/home')
            });    
    }
    return(
        <Router>
                            <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
                                <Navbar.Brand href="#home">React Bootstrap Navbar</Navbar.Brand>
                                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                                <Navbar.Collapse id="basic-navbar-nav">
                                    <Nav className="mr-auto">
                                    <Nav.Link href="/">Home</Nav.Link>
                                    <Nav.Link href="/about-us">Contact Us</Nav.Link>
                                    <Nav.Link href="/contact-us">About Us</Nav.Link>
                                    <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                                        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                                        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                                        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                                        <NavDropdown.Divider />
                                        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                                    </NavDropdown>
                                    </Nav>
                                    <Form inline>
                                    <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                                    <Button variant="outline-success">Search</Button>
                                    </Form>
                                </Navbar.Collapse>
                            </Navbar>
                            <br />
                            <Switch>
                                <Route exact path="/">
                                    <Home />
                                </Route>
                                <Route path="/about-us">
                                    <AboutUs />
                                </Route>
                                <Route path="/contact-us">
                                    <ContactUs />
                                </Route>
                            </Switch>
                        </Router>
        // <nav className="navbar navbar-dark bg-primary">
        //     <div className="row col-12 d-flex justify-content-center text-white">
        //         <span className="h3">{props.title || title}</span>
        //         {renderLogout()}
        //     </div>
        // </nav>
    )
}
export default withRouter(Header);
